import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
//////////////////////COMPONENTES//////////
function App() {
  return (   
      <div className='app'> 
      <Router>
        <Route exact path="/" render={() => {
          <div>

          <body>
            <header>
            <Content mytext="LOGIN"/>
            <Date />
           </header>
            <Content mytext="ADMINISTRADOR"/>
            <br></br>
            <Content mytext="HUELLA"/>
        </body>


            </div>
        }}></Route>
       </Router>
      </div> 

  );
}

export default App;
